        var server_date = new Date();
        server_date.setTime(cjs.dic.get("util_date").getTimestamp() * 1000);
        tudate = Date.UTC(server_date.getUTCFullYear(), server_date.getUTCMonth(), server_date.getUTCDate()) / 1000;

